import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./breadcrumb.css";

const Bread = () => {
  const [link, setLink] = useState();

  return (
    <div class="container">
      <h1>Breadcrumb</h1>
      <ul class="breadcrumb">
        <ol class="item">
          <Link to="/">Home</Link>
        </ol>
        <ol class="item">Level 1</ol>
        <ol class="item">Level 2</ol>
      </ul>
    </div>
  );
};

export default Bread;
